import React from 'react'
import App from './App.js'



export default class DogBar extends React.Component {

    render(){
        return (
            <div id="dog-bar">
                {this.props.dogs.map(dog =>{
              <span>dog.name}</span> })}   
              </div>
        )
    }
}
